    default_auto_field = 'django.db.models.BigAutoField'
    name = 'avengers'

class Avengers(models.Model):
    fname = models.CharField(max_length=20)
    lname = models.CharField(max_length=20)
    def __str__(self):
        return self.fname + " " + self.lname

urlpatterns = [
